export {}
const { decode } = require('base64-arraybuffer')
const { restart } = require('../utils/functions')
const {
    MessageType
} = require('@adiwajshing/baileys')

module.exports = {
    name: 'restart',
    description: 'Untuk merestart bot _only owner_',
    async execute (client: any, chat: any, pesan: any, args: any) {
        if (!client.isOwner && !client.isSudo) return client.reply(pesan.hanya.owner)
        const from = client.from
        const shutdown = await decode('') // Big Blobs
        await client.sendMessage(from, shutdown, MessageType.audio, { mimetype: 'audio/mp4', filename: 'shutdown.mp3', quoted: chat })
        await restart()
    }
}
